#include <fuzzer/FuzzedDataProvider.h>

#include <stddef.h>
#include <stdint.h>

#include "GString.h"
#include "GlobalParams.h"
#include "OutputDev.h"
#include "PDFDoc.h"
#include "Object.h"
#include "Stream.h"
#include "Dict.h"
#include "XRef.h" // Include the header file that defines 'Ref'
#include "GfxState.h" // Include the header file that defines 'GfxState'
#include "Gfx.h" // Include the header file that defines 'Gfx'

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeBool();
  GBool crop = fdp.ConsumeBool();
  GBool printing = fdp.ConsumeBool();
  int sliceX = fdp.ConsumeIntegral<int>();
  int sliceY = fdp.ConsumeIntegral<int>();
  int sliceW = fdp.ConsumeIntegral<int>();
  int sliceH = fdp.ConsumeIntegral<int>();
  std::vector<char> buf = fdp.ConsumeRemainingBytes<char>();

  globalParams = new GlobalParams("/usr/local/etc/xpdfrc");
  globalParams->setupBaseFonts("/usr/share/ghostscript/9.25/Resource/cidfmap");

  Object obj;
  obj.initNull();
  MemStream *str = new MemStream(buf.data(), 0, buf.size(), &obj);

  PDFDoc *doc = NULL;
  try {
    doc = new PDFDoc(str, NULL, NULL, NULL);
    if (doc->isOk()) {
      OutputDev *output_dev = nullptr;
      doc->displayPageSlice(output_dev, 1, hDPI, vDPI, rotate, useMediaBox, crop, printing, sliceX, sliceY, sliceW, sliceH, NULL, NULL);
    }
  } catch (...) {}

  delete doc;
  delete globalParams;

  return 0;
}
